import React from 'react';
import {Text, TextInput, View} from 'react-native';

const Cat = () => {
    return (
    <View>
        <Text>Hello, I am your cat!</Text>
        <TextInput defaultValue='Name me!'/>
    </View>)
}

export default Cat;
